(function() {
  $(function() {
    'use strict';
    var Calculator, calculator;
    Calculator = (function() {
      function Calculator(exchange_rate) {
        this.exchange_rate = exchange_rate;
        $('#btc_calculator_input, #usd_calculator_input').on('change keyup', (function(_this) {
          return function(evt) {
            var type;
            type = evt.currentTarget.id === 'btc_calculator_input' ? 'btc' : 'usd';
            return _this.calculate_exchange(evt.currentTarget.value, type);
          };
        })(this));
        $("input[name=bitcoin_calculator]:radio").change((function(_this) {
          return function(evt) {
            var type;
            type = evt.currentTarget.value;
            if (type === 'btc') {
              if (!$('#usd_calculator_input').closest('.form-group').hasClass('hide')) {
                $('#usd_calculator_input').closest('.form-group').addClass('hide');
              }
              if ($('#usd_value').closest('div').hasClass('hide')) {
                $('#usd_value').closest('div').removeClass('hide');
              }
              if ($('#btc_calculator_input').closest('.form-group').hasClass('hide')) {
                $('#btc_calculator_input').closest('.form-group').removeClass('hide');
              }
              if (!$('#btc_value').closest('div').hasClass('hide')) {
                return $('#btc_value').closest('div').addClass('hide');
              }
            } else if (type === 'usd') {
              if ($('#usd_calculator_input').closest('.form-group').hasClass('hide')) {
                $('#usd_calculator_input').closest('.form-group').removeClass('hide');
              }
              if (!$('#usd_value').closest('div').hasClass('hide')) {
                $('#usd_value').closest('div').addClass('hide');
              }
              if (!$('#btc_calculator_input').closest('.form-group').hasClass('hide')) {
                $('#btc_calculator_input').closest('.form-group').addClass('hide');
              }
              if ($('#btc_value').closest('div').hasClass('hide')) {
                return $('#btc_value').closest('div').removeClass('hide');
              }
            }
          };
        })(this));
      }

      Calculator.prototype.calculate_exchange = function(num, type) {
        var final_rate;
        final_rate = type === 'btc' ? this.exchange_rate * num : num / this.exchange_rate;
        if (type === 'btc') {
          $('#btc_value').text(num);
          $('#usd_value').text(final_rate.toFixed(2).toLocaleString());
          return $('#usd_calculator_input').val(final_rate.toFixed(2).toLocaleString());
        } else if (type === 'usd') {
          $('#usd_value').text(num);
          $('#btc_value').text(final_rate.toFixed(8));
          return $('#btc_calculator_input').val(final_rate.toFixed(8));
        }
      };

      return Calculator;

    })();
    return calculator = new Calculator($('body').data('exchange_rate'));
  });

}).call(this);
